Param (
    [Parameter (Mandatory=$false)][ValidateRange(0,1151)][int]$Int = 0,
    [Parameter (Mandatory=$false)][string[]]$Cmd = "cmd.exe",
    [Parameter (Mandatory=$false)][string[]]$Overflow
   
    )

#region Dev/Test setup
if ( Test-Path variable:\psEditor ) {  # testing hacks - VSCode:
    $Current_File = $psEditor.GetEditorContext().CurrentFile.Path
    $int = 64
    $cmd = """C:\Program Files (x86)\Internet Explorer\iexplore.exe"" http://google.com"
    $cmd = "notepad.exe"; if ( test-path Variable:exeargs ) { remove-item Variable:exeargs }
    $cmd = "notepad.EXE ""F:\Packages\System\Packaging\Interview Questions\Packager Technical questions.docx"""
    $cmd = "C:\Windows\System32\odbcad32.exe"
    $cmd = "reg.exe"
    $debug = $true
    # 2022-03-08
    $int = 1024
    $cmd = "F:\Packages\System\Packaging\RunV3\run\run.exe ""powershell.exe -exec bypass -nop -f F:\Packages\Games\Minecraft\MC.Server.Startup.ps1"""
    $cmd = "powershell.exe -exec bypass -nop -file F:\Packages\System\Packaging\RunV3\run\run.ps1 ""powershell.exe -exec bypass -nop -f F:\Packages\Games\Minecraft\MC.ServerStartup.ps1"""
    $Current_File = "Run.exe"
    $Current_File = "Run.ps1"
} elseif (Test-Path variable:\psISE ) {  # testing hacks - ISE:
    $Current_File = Split-Path $psise.CurrentFile.FullPath
} else {
    # breaks when compiled: $Current_File = ([io.fileinfo]$MyInvocation.MyCommand.Definition).Name
    # https://stackoverflow.com/questions/53134414/powershell-myinvocation-mycommand-path-returns-null-when-convert-script-in-exe
    if ($MyInvocation.MyCommand.CommandType -eq "ExternalScript") { 
        # $Current_File = ([io.fileinfo]$MyInvocation.MyCommand.Definition).Name 
        $Current_File = Split-Path -Leaf -Path $MyInvocation.MyCommand.Definition 
    }
    else { $Current_File = Split-Path -Leaf -Path ([Environment]::GetCommandLineArgs()[0]) }
}
#endregion

# Strip out flawed handling when compiled
$cmd = $cmd.ToLower().Replace('-cmd:','')
#region Int calculation logic
$msg = "$Current_File`r`n`r`nReceived integer: [$Int]`r`nReceived command: [$Cmd]`r`n"
if ( $Int -gt 0 )    { $msg = $msg+"`r`nReceived feature parameters:`r`n"}
if ( $Int -ge 1024 )  { $debug = $true;    $Int = $Int - 1024;  $msg = $msg+" - 1024: DEBUG on `r`n"}
if ( $Int -ge 128 )   { $browser = $true;  $Int = $Int - 128;   $msg = $msg+" -  128: Browser on`r`n"}
if ( $Int -ge 64 )    { $64bit = $true;    $Int = $Int - 64;    $msg = $msg+" -   64: 64-bit on`r`n"}
if ( $Int -ge 32 )    { $wait = $true;     $Int = $Int - 32;    $msg = $msg+" -   32: Wait on `r`n"}
if ( $Int -ge 16 )    { $8dot3 = $true;    $Int = $Int - 16;    $msg = $msg+" -   16: 8.3 support on `r`n"}
if ( $Int -ge 8 )     { $max = $true;      $Int = $Int - 8;     $msg = $msg+" -    8: Maximised on `r`n"}
if ( $Int -ge 4 )     { $min = $true;      $Int = $Int - 4;     $msg = $msg+" -    4: Minimised on `r`n"}
if ( $Int -ge 2 )     { $hide = $true;     $Int = $Int - 2;     $msg = $msg+" -    2: Hidden on `r`n"}
if ( $Int -ge 1 )     { $iconoff = $true;  $Int = $Int - 1;     $msg = $msg+" -    1: Systray icon off (on by default) `r`n"}
if (test-path Variable:\debug) {$msg = $msg+"Int remainder: $Int"}
#endregion Int calculation logic


#region Features
#   Test for if we need to instantiate the default browser with $cmd as the URL provided...
if ( $browser ) {  # then $cmd is just a URL?
    $httphandler = (Get-ItemProperty registry::HKEY_CURRENT_USER\SOFTWARE\Microsoft\Windows\Shell\Associations\UrlAssociations\http\UserChoice -Name ProgId).ProgId
    $httphandler = (Get-ItemProperty registry::HKEY_CLASSES_ROOT\$httphandler\shell\open\command -Name '(default)').'(default)'
    
    $exeends = $httphandler.IndexOf(".exe")+5                           # find the end of the first .exe
    $exeargs = $httphandler.Substring($exeends)                         # everything else goes into the args
    $exeargs = $exeargs.replace('%1',$cmd)                              # strip %1 of course
    $exeargs = $exeargs.Trim()                                          # strip spaces

    $exe = $httphandler.Substring(0,$exeends)                           # Grab just the .EXE path
    $exe = $exe.replace('"','')                                         # strip quotes
    $cmd = $exe+" "+$exeargs                                            # put it all back together...
    $msg = $msg+"`r`n`r`nConverted for browser to:`r`n`'$exe`'`r`n`'$exeargs`'"


} else {
    # break down the command supplied -  Find out binary and if any args exist


    if ( $cmd.Contains($Current_File) ) {                                       # remove run.exe from the logic so it only deals with the secondary process (I guess this trims the unspecified -int as well, possibly):
        $msg = $msg+"`r`n`r`Current file: [$Current_File] - this was also found in Cmd..."
        $StripSelfPosition = $cmd.ToLower().IndexOf($Current_File.ToLower())    # find where run.??? 'begins' in the string
        $StripSelfPosition = $StripSelfPosition+$Current_File.Length+1          # include run.??? + the space
        $msg = $msg+"`r`n`r`Stripping from char: [$StripSelfPosition]"
        $cmdToWorkWith = $cmd.Substring($StripSelfPosition)                     # So this is the meat of what we're actually wanting launched
        $msg = $msg+"`r`n`r`CmdToWorkWith: [$cmdToWorkWith]"
    } else { 
        $cmdToWorkWith = $cmd.ToLower()                                         # why can't i just copy the variable $cmdtoWorkWith = $cmd?
    }

    
    $exeends = $cmdToWorkWith.ToLower().IndexOf(".exe")+5                # find the end of the first .exe - CASE-INSENSITIVE!
    if ($cmdToWorkWith.Length -gt $exeends) {
        $exe = $cmdToWorkWith.Substring(0,$exeends)                      # Grab just the .EXE path
        $msg = $msg+"`r`n`r`Found long arguments. Trimming to [$exe]"
        $exeargs = $cmdToWorkWith.Substring($exeends)                    # everything else goes into the args
        $exeargs = $exeargs.Trim()                                       # strip spaces
    } else {
        # $msg = $msg+"`r`n`n`r`Didnt find long arguments. CmdToWorkWith.Length:$($cmdToWorkWith.Length), Exeends:$exeends"   # maybe we're just launching notepad.exe?
        if ( $overflow ) { } #$exeargs = $overflow 
        else { $exeargs = $false }
        $exe = $cmdToWorkWith
    }

    if ( $Overflow -and ($exeargs -ne $false) ) { 
        $msg = $msg+"`r`n`r`Concatenating argument overflow [$Overflow] after [$exeargs]"
        $exeargs = "$exeargs $Overflow"
    }

    if ( $64bit ) {
        $msg = $msg+"`r`n`r`nWoW64 support on: "
        if ( $exe.ToLower().contains($env:SystemRoot.ToLower()) ) { 
            $exe = $exe.ToLower().Replace('system32','sysnative') 
            $msg = $msg+"Converting System32 to Sysnative"
        } else { 
            if ( test-path "$env:SystemRoot\Sysnative\$exe" ) { 
                $exe = "$env:SystemRoot\Sysnative\$exe"
                $msg = $msg+"Assuming Sysnative on unqualified command."
            } else {
                $msg = $msg+"Hacking WoW64 via $Env:windir\Sysnative\cmd.exe - THIS IS PROBABLY NEVER USED / REDUNDANT?"
                if ( $exeargs ) { $exeargs = "/c $Env:windir\System32\$exe $exeargs" }
                else { $exeargs = "/c $Env:windir\System32\$exe" }
                $exe = "$Env:windir\Sysnative\cmd.exe"
            }
        }
    }
    $exe = $exe.replace('"','')                                         # strip quotes
    $exe = $exe.trim()                                                  # blanks

    
    $msg = $msg+"`r`n`r`nConverted to: [$exe]`r`n`Arguments: [$exeargs]"


<# I decided not to bother with this, PoSh is already strict enough on launching things...  Not sure which is the lesser mistake TBH!
    if ( test-path $exe ) {"found $exe" }
    else { write-host $msg; throw "Couldn't find $exe - aborting..." } # No .EXE - no bueno...
#>
}


if ( $8dot3 ) { # https://community.idera.com/database-tools/powershell/powertips/b/tips/posts/converting-file-paths-to-8-3-part-2

    $regblock = Get-ItemPropertyValue registry::HKEY_LOCAL_MACHINE\SYSTEM\CurrentControlSet\Control\FileSystem -Name NtfsDisable8dot3NameCreation
    if ( $regblock -ne 1 ) { # technically, the filesystem *could* still have 8.3 disabled, but at least the OS doesn't disallow it system-wide...

        #signature of internal API call:
        $signature = '[DllImport("kernel32.dll", SetLastError=true)] public static extern int GetShortPathName(String pathName, StringBuilder shortName, int cbShortName);'
        # turn signature into .NET type:
        Add-Type -MemberDefinition $signature -Namespace Tools -Name Path -UsingNamespace System.Text
        $sb = [System.Text.StringBuilder]::new(300)                      # create empty string builder with 300-character capacity
        $rv = [Tools.Path]::GetShortPathName($exe, $sb, 300)             # ask Windows to convert long path to short path with a max of 300 characters
        if ($rv -ne 0){
            $exe = $sb.ToString()
            $msg = $msg+"`r`n`r`nFurther converted to 8.3:'$exe`'`r`n`Arguments:'$exeargs`'"
        } else { throw "Errors converting $cmd to 8.3 - Are 8.3 names supported by the filesystem?" }
    } else { throw "8.3 is disabled by regkey NtfsDisable8dot3NameCreation!" }
}


if ( $max -and -not($min -or $hide)) {$ws = "Maximized"}
if ( $min -and -not($max -or $hide)) {$ws = "Minimized"}
if ( $hide -and -not($min -or $max)) {$ws = "Hidden"}
if (test-path Variable:\ws){$msg = $msg+"`r`nWindowStyle: [$ws]"}
if ($debug) {write-host $msg}
#endregion Features


#region Splatting for Start-Process
# initialize a hashtable we'll use to splat with later that has all of the params that will always be used (it can also be empty)
# Great advice from Ryan Bolger at https://serverfault.com/questions/1069894/how-do-i-optionally-specify-parameters-in-powershell/1069912#1069912
$startParams = @{ FilePath = $exe }
if ($ws) { $startParams.WindowStyle = $ws }                #  conditionally add WindowStyle
if ($wait) { $startParams.wait = $true }                   # conditionally add Wait
if ($exeargs) { $startParams.ArgumentList = $exeargs }     # conditionally add arguments
#endregion Splatting for Start-Process


#The systray icon and wait can't really co-exist, so:
if ($iconoff -or $wait) {                                    # No systray icon, just launch it!
    Start-Process @startParams                               # spawn process...  Fsckin finally!
} else {                                                     # make a fancy systray icon...  Big tedious mess of GUI crap:
#region  Fugly, tedious, GUI crap
    <# 
    Systray stuff shamelessly stolen from https://www.systanddeploy.com/2018/12/create-your-own-powershell.html
    WinForms stuff shamelessly stolen from:
        https://www.systanddeploy.com/2019/08/modern-dialog-with-powershell-and-wpf.html
        & https://github.com/damienvanrobaeys/Build-PS1-Systray-Tool/tree/master/MySystrayTool
        https://4sysops.com/archives/create-a-gui-for-your-powershell-script-with-wpf/
    Icon shamelessly stolen from Freepik: https://www.flaticon.com/free-icon/cog_313616
      See https://www.freepik.com/
    #>

    # Add assemblies for WPF & forms
    [System.Reflection.Assembly]::LoadWithPartialName('System.Windows.Forms')    | out-null
    [System.Reflection.Assembly]::LoadWithPartialName('presentationframework')   | out-null
    [System.Reflection.Assembly]::LoadWithPartialName('System.Drawing')          | out-null
    [System.Reflection.Assembly]::LoadWithPartialName('WindowsFormsIntegration') | out-null
    

    # Choose an icon to display in the systray
    # $icon = [System.Drawing.Icon]::ExtractAssociatedIcon("$Current_Folder\cog.ico") 
    # We won't be using an external file - lets embed it!    https://stackoverflow.com/questions/53376491/how-to-embed-an-icon-in-a-powershell-gui-executable/53377253#53377253
    #region Horrible icon crap - Collapse this!
$iconbase64 = ''
    #endregion Horrible icon crap
    $iconBytes = [Convert]::FromBase64String($iconBase64)
    $stream = [System.IO.MemoryStream]::new($iconBytes, 0, $iconBytes.Length)
    $icon = [System.Drawing.Icon]::FromHandle(([System.Drawing.Bitmap]::new($stream).GetHIcon()))


    # Basic forms garbage
    $form = New-Object System.Windows.Forms.Form
    $form.Text = "$Current_File Analysis..."
    $form.Size = New-Object System.Drawing.Size(525,290)
    $form.StartPosition = 'CenterScreen'
    $form.add_FormClosing({$timer1.Start()})	# resume timer once the analysis dialog is closed

    # Debug text label
    $TextBox = New-Object System.Windows.Forms.TextBox
    $TextBox.Location = New-Object System.Drawing.Point(7,7)
    $TextBox.Size = New-Object System.Drawing.Size(495,230)
    $TextBox.Text = $msg
    $TextBox.Multiline = $true
    $form.Controls.Add($TextBox)

    # Add the systray icon 
    $Main_Tool_Icon = New-Object System.Windows.Forms.NotifyIcon
    $Main_Tool_Icon.Text = $Current_File
    $Main_Tool_Icon.Icon = $icon
    $Main_Tool_Icon.Visible = $true
    
    # Add menu users
    $Current_File_analysis = New-Object System.Windows.Forms.MenuItem
    $Current_File_analysis.Text = "$Current_File Analysis"
    
    # Add menu exit
    $Menu_Exit = New-Object System.Windows.Forms.MenuItem
    $Menu_Exit.Text = "Exit"
    
    # Add all menus as context menus
    $contextmenu = New-Object System.Windows.Forms.ContextMenu
    $Main_Tool_Icon.ContextMenu = $contextmenu
    $Main_Tool_Icon.contextMenu.MenuItems.AddRange($Current_File_analysis)
    $Main_Tool_Icon.contextMenu.MenuItems.AddRange($Menu_Exit)


    # ---------------------------------------------------------------------
    # Action after clicking on Current_File analysis
    # ---------------------------------------------------------------------
    $Current_File_analysis.Add_Click({
        $timer1.Stop()
        $form.ShowDialog()
    })


    # ---------------------------------------------------------------------
    # Action when after a click on the systray icon
    # ---------------------------------------------------------------------
    $Main_Tool_Icon.Add_Click({					
        # Nasty WPF thingy? https://stackoverflow.com/questions/3870498/is-it-absolutely-safe-to-display-a-wpf-window-from-a-winforms-form/3873048
        # [System.Windows.Forms.Integration.ElementHost]::EnableModelessKeyboardInterop($Users_Window)
        If ($_.Button -eq [Windows.Forms.MouseButtons]::Left) {
            $Users_Window.WindowStartupLocation = "CenterScreen"
            $Users_Window.Show()
            $Users_Window.Activate()	
        }				
    })

    # When Exit is clicked, close everything and kill the PowerShell process
    $Menu_Exit.add_Click({
        $Main_Tool_Icon.Visible = $false
        #$Users_Window.Close()
        Stop-Process $pid
    })

    # Make PowerShell Disappear - Thanks Chrissy
    $windowcode = '[DllImport("user32.dll")] public static extern bool ShowWindowAsync(IntPtr hWnd, int nCmdShow);'
    $asyncwindow = Add-Type -MemberDefinition $windowcode -name Win32ShowWindowAsync -namespace Win32Functions -PassThru
    $null = $asyncwindow::ShowWindowAsync((Get-Process -PID $pid).MainWindowHandle, 0)
    
    # Use a Garbage colection to reduce Memory RAM
    # https://dmitrysotnikov.wordpress.com/2012/02/24/freeing-up-memory-in-powershell-using-garbage-collector/
    # https://docs.microsoft.com/fr-fr/dotnet/api/system.gc.collect?view=netframework-4.7.2
    [System.GC]::Collect()
    
    # timer stolen from https://www.sapien.com/blog/2008/12/18/winforms-and-timers/
    $timer1 = New-Object System.windows.Forms.Timer             # add the timer control
    $timer1.Enabled=$True                                       # enable it
    $interval=5                                                 # set the timer interval, 5s
    $timer1.Interval = ($interval * 1000)                       # interval is ms
    $timer1.add_Tick({                                          # what to 'do' when timer completes...
        $Main_Tool_Icon.Visible = $false
        Stop-Process $pid
    })
    $timer1.Start()                                             # start the timer
#endregion Fugly, tedious, GUI crap


    # spawn process...  Fsckin finally!
    $returncode = Start-Process @startParams                                  # run the function with the splatted hashtable.  Replaces:


    # Create an application context for it to all run within - Thanks Chrissy
    # This helps with responsiveness, especially when clicking Exit - Thanks Chrissy
    $appContext = New-Object System.Windows.Forms.ApplicationContext
    [void][System.Windows.Forms.Application]::Run($appContext)

}